import React, { Component } from 'react'
import './App.css';
import Navbars from './Componets/Navbars';
import NewsShow from './Componets/NewsShow';
import Spinner from './Componets/Spinner';
export class App extends Component {
  render() {
    return (
      <div>
      <Navbars/>
      <Spinner/>
      <NewsShow/>
      </div>
    )
  }
}

export default App
